import React from "react";

import backDropVideo from "./video/backDropVideo.mp4";

function Home() {
  return (
    <div>
      <video id="background" autoPlay loop muted>
        <source src={backDropVideo} type="video/mp4" />
      </video>
      <h2 id="gameTitle">HEDGE*</h2>
    </div>
  );
}

export default Home;
